INSERT INTO `instructions` (`id`, `title`, `slug`, `content`, `created_at`, `updated_at`) VALUES
(1, 'Instructions', 'instructions', '1. As you enter show your Student ID card.\r\n2.Make sure your mobile phone is switched off and place it at the front together with any bags, books, coats etc. Then find your seat.\r\n3.Remember that talking is not allowed at any time in the exam hall.\r\n4.Place your Student ID card on your desk next to your attendance card.\r\n5.Listen carefully to instructions. Students are required to comply with the instructions of invigilators at all times. For example, if you are asked to sit in a designated place then you must do so and you must not move.', '2016-06-08 03:32:59', '2017-02-18 09:00:05');
