(2, 2, 1790, 'Hi Lambert\r\n\r\n                     I hope your doing well, i think your not coming college from last one week\r\n\r\n', '2017-02-22 07:12:31', '2017-02-22 07:12:31'),
(3, 3, 1790, 'Hi Beaulah,\r\n\r\n                             Could You prepare Sem Exam Time Table', '2017-02-22 07:13:42', '2017-02-22 07:13:42'),
(4, 4, 1790, 'Hi All, \r\n\r\n                       Tomorrow we don\'t College And it is Holiday see you all day after tomorrow.', '2017-02-22 07:16:20', '2017-02-22 07:16:20'),
(5, 4, 2143, 'Hi Admin,\r\n\r\n                           Thank You . How is children is studying .\r\n', '2017-02-22 07:19:04', '2017-02-22 07:19:04'),
(6, 1, 2143, 'Hi Admin,\r\n\r\n                              Ya Now White studying well thank you very much for your support . ', '2017-02-22 07:20:00', '2017-02-22 07:20:00'),
(7, 1, 2143, 'When sem exams will be Start ?\r\n', '2017-02-22 07:20:42', '2017-02-22 07:20:42'),
(8, 5, 2143, 'Hi Beaulah,\r\n                            How are you . My i know the Unit exams time table', '2017-02-22 07:22:40', '2017-02-22 07:22:40'),
(9, 6, 2143, 'Hi Dr. Beaulah ,\r\n\r\n                        Today my son is not well so his not coming college  today .\r\n\r\n\r\n', '2017-02-22 07:24:24', '2017-02-22 07:24:24'),
(10, 3, 2058, 'Okay Sir', '2017-02-22 07:26:18', '2017-02-22 07:26:18'),
(11, 7, 2058, 'Exam Time Table is Completed . in soon we will tell you . Thanks', '2017-02-22 07:28:10', '2017-02-22 07:28:10'),
(12, 8, 2143, 'Hi Beaulah,\r\n  \r\n                         I Didn\'t Get time table please check and Re-send it. Thank You', '2017-02-22 07:29:59', '2017-02-22 07:29:59'),
(13, 7, 2143, 'Okay Beaulah Thank You', '2017-02-22 07:30:28', '2017-02-22 07:30:28'),
(14, 8, 2058, 'Sorry . Due to some network Problem it happend i will send today ', '2017-02-22 07:32:12', '2017-02-22 07:32:12'),
(15, 4, 2058, 'Okay Sir Thank , Will Meet you ', '2017-02-22 07:32:40', '2017-02-22 07:32:40'),
(16, 9, 1953, 'Hi Admin,\r\n\r\n                         Could You update the Sql materies in LMS', '2017-02-22 07:35:21', '2017-02-22 07:35:21'),
(17, 10, 1953, 'Hi Sir,\r\n\r\n                 is Tomorrow Holiday?', '2017-02-22 07:36:45', '2017-02-22 07:36:45'),
(18, 11, 1953, 'Hi Admin,\r\n\r\n                            As my parent said i am not well today so i am not coming college today.\r\n\r\n', '2017-02-22 07:38:04', '2017-02-22 07:38:04'),
(19, 4, 1953, 'Oh! Great', '2017-02-22 07:38:24', '2017-02-22 07:38:24'),
(20, 7, 1953, 'Thank Beaulah', '2017-02-22 07:38:51', '2017-02-22 07:38:51');
