(492, 27, 71, '', '8971f497516e5e7a221bcd1315ce7a9fe4eb6af7', 'radio', '<p>Select a figure from amongst the Answer Figures which will continue the same series as established by the five</p>\r\n\r\n<p>Problem Figures.</p>\r\n', '492question.png', 0, 5, '[{"option_value":"1","has_file":0,"file_name":""},{"option_value":"2","has_file":0,"file_name":""},{"option_value":"3","has_file":0,"file_name":""},{"option_value":"4","has_file":0,"file_name":""},{"option_value":"5","has_file":0,"file_name":""}]', 1, '3', 2, 10, 'easy', '', '<p>In each step, element at the upper-right position gets enlarged, inverts vertically and reaches the lower-left corner; the existing element at the lower-left position, is lost and a new small element appears at the upper-right position.</p>\r\n', NULL, 1, '2017-02-22 10:09:12', '2017-02-22 10:09:12'),
(493, 28, 74, '', 'ce6eb057c6acff8b84962b459e791f1a505ff9ef', 'video', '<p>Watch the video and answer the following questions</p>\r\n', '493question.mp4', 0, 2, '[{"question":"What is the video name?","total_options":"2","options":[["Bick Buck","Bick Buck Bunny"]]},{"question":"What is the video name?","total_options":"2","options":{"1":["Animation","Normal"]}}]', 2, '[{"answer":"2"},{"answer":"1"}]', 10, 300, 'easy', '', '<p>No explanation</p>\r\n', NULL, 1, '2017-02-22 10:12:25', '2017-02-22 10:12:25');
